  return (
    <React.Fragment>
      <Navbar />
      <div className={classes.head}>
        <h1>Contact US</h1>
        <h3>
          Any questions or remarks?
          <br /> Just drop us a message!
        </h3>
        <img src="/assets/Line 6.png"></img>
      </div>
      <div className="container">
        <div className={classes.data}>
          <h2>First Name ✸</h2>
          <input type="text" />
          <h2>Last Name</h2>
          <input type="text" />
          <h2>Email ✸</h2>
          <input type="text" />
          <h2>Mobile ✸</h2>
          <input type="text" />
        </div>
        <div>hi</div>
      </div>
      <Footer />
    </React.Fragment>
  );
};
export default Contact;
